import React from 'react';
import { Grid, GridColumn } from 'semantic-ui-react';

const Game = (props) => {
    const { game } = props
    return (
        <Grid columns={3} divided>
            <Grid.Row>
                <Grid.Column>

                </Grid.Column>
            </Grid.Row>
            <h1>Game Name: {game.title}</h1> 
            <p>Game Price:{game.price}</p>
            <p>Game Description:{game.details}</p>
            <img src={game.img} />
        </Grid>
    )
}



export default Game;
